import Starter from "./Starter";

const Pricing = () =>{
    return(
        <section className="Pricing_features">
        <div className="container">
        <Starter 
                starter_heading="Pricing plan"
                starter_heading_2 = "Pricing plan"
            />
        </div>
        

        </section>

    )
}

export default Pricing;
